import { Injectable } from "@angular/core";
import { Recipe } from "../model/recipe";

@Injectable({
    providedIn: "root",
})
export class RecipeService {
    private RECIPES = [
        new Recipe("id1", "name1", "body1 body body body \nbody\nbody\nbody\nbody\nbody\nbody\nbody\nbody\nbody\nbody\nbody\nbody\nbody\nbody\nbody\nbody\nbody", ["tag1", "tag2", "a very long tag with whitespace", "a very looooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooooong tag with whitespace"]),
        new Recipe("id02", "name2", "body2", ["tag1", "tag3"], ["data:image/jpeg;charset=ascii;base64,", "data:image/jpeg;charset=ascii;base64,"]),
        new Recipe("id3", "name3 name3 name3 name3 name3 name3 name3 name3 name3 name3", "body3", ["tag1", "tag2"]),
        new Recipe("id4", "name4's & stuff", "body4", ["tag1", "tag4"]),
        new Recipe("id5", "name5", "body3", ["tag1", "tag2"]),
        new Recipe("id6", "name6", "body4", ["tag1", "tag4"]),
        new Recipe("id7", "name7", "body3", ["tag1", "tag2"]),
    ];

    getAllRecipes(): Array<Recipe> {
        return this.RECIPES;
    }

    getAllTags(): Array<string> {
        let set: Array<string> = [];
        for (const recipe of this.RECIPES) {
            for (const tag of recipe.tags) {
                if (!set.includes(tag)) {
                    set.push(tag);
                }
            }
        }
        return set;
    }

    getAllByPage(pageIndex: number, pageSize: number): [number, Recipe[]] {
        const slice = this.RECIPES.slice((pageIndex - 1) * pageSize, pageIndex * pageSize);
        return [this.RECIPES.length, slice];
    }

    searchTagsByPage(term: string, pageIndex: number, pageSize: number): [number, Recipe[]] {
        const results = [];
        if (term != null && term != undefined) {
            for (const recipe of this.RECIPES) {
                if (recipe.tags.includes(term)) {
                    results.push(recipe);
                }
            }
        }
        const slice = results.slice((pageIndex - 1) * pageSize, pageIndex * pageSize);
        return [results.length, slice];
    }

    searchAllByPage(term: string, pageIndex: number, pageSize: number): [number, Recipe[]] {
        const results = [];
        if (term != null && term != undefined) {
            for (const recipe of this.RECIPES) {
                if (recipe.tags.includes(term)) {
                    results.push(recipe);
                } else if (recipe.name.includes(term)) {
                    results.push(recipe);
                } else if (recipe.body.includes(term)) {
                    results.push(recipe);
                }
            }
        }
        const slice = results.slice((pageIndex - 1) * pageSize, pageIndex * pageSize);
        return [results.length, slice];
    }

    get(id: string): Recipe {
        for (const recipe of this.RECIPES) {
            if (recipe.id == id) {
                return recipe;
            }
        }
        throw new Error("No recipe found with id=" + id);
    }

    create(name: string, body: string, tags: string[], images: string[]) {
        const recipe = new Recipe("id" + (this.RECIPES.length + 1), name, body, tags, images)
        this.RECIPES.push(recipe);
        return recipe;
    }

    delete(id: string) {
        for (let index = 0; index < this.RECIPES.length; index++) {
            const recipe = this.RECIPES[index];
            if (recipe.id == id) {
                this.RECIPES.splice(index, 1);
            }
        }
    }

    update(id: string, name: string, body: string, tags: string[], images: string[]): Recipe {
        for (const recipe of this.RECIPES) {
            if (recipe.id == id) {
                recipe.name = name;
                recipe.body = body;
                recipe.tags = tags;
                recipe.images = images;
                return recipe;
            }
        }
        throw new Error("No recipe found with id=" + id);
    }
}